import "./viewScreenMain.css";
import React from "react";

const ViewScreenMain = () => {

  return (
    <>
      <div>
      <div id="zoomareaFeed">
        <div className="feed-table-parent">
          <div className="feed-table-child">
            <div className="feed-table">
              <table className="table-responsive" id="active-feed-table">
                <tbody className="feed-content">
                  {demoInput.map((item, index) => (
                    <tr id="feed-row">
                      <td
                        className="lineNo px-2"
                        id={"lineNumber" + index}
                        onClick={() => {
                          markLine(index);
                        }}
                      >
                        {item.lineNo}
                      </td>
                      <td
                        className="timecode"
                        id="timeCode"
                        onClick={() => {
                          markLine(index);
                        }}
                      >
                        {item.timeCode}
                      </td>
                      <td className="line-annotation">
                        <button
                          id="markLine"
                          className="hide-mark"
                          onClick={() => {
                            markLine(index);
                          }}
                        ></button>
                      </td>
                      <td className="text" id={"feedText" + index}>
                        {item.text}
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
      </div>
    </>
  );
};
export default ViewScreenMain;
